var index={};
var inputBox = document.getElementById('input');
var outputBox = document.getElementById('output');
var lastOutput = '';

inputBox.addEventListener('keydown', onKey);
document.getElementById('copyButt').onclick = copyToClip;

function onKey(e) {
  if (e.isComposing || e.code !== 'Enter') {
    return;
  }
  let text = inputBox.value;
  if (e.shiftKey) {
      return;
  }
  e.preventDefault();
  text = emojify(text);
  lastOutput = text;
  let re = /\n/g;
  let count=0;
  let ary;
  while ((ary = re.exec(text)) !== null) {
    count++;
  }
  while (count < 11) {
    text += '\n';
    count++;
  }
  text = text.replace(/\n/g, '<br/>');
  outputBox.innerHTML = twemoji.parse(text);
  // outputBox.style.height = outputBox.scrollHeight;
}

function emojify(text) {
  let words = text.split('\n').join(' \n');
  words = words.split(' ');
  for (var i = 0; i < words.length; i++) {
    let word = words[i];
    if (word === '' || word === '\n') {
      continue;
    }
    if (word.slice(0,1) === '\n') {
      word = word.slice(1);
    }
    if (commonWords.includes(word) && Math.random() > 0.5) {
      word = makeCommonSwap(word);
    }
    let kwd = word.toUpperCase();
    while (index[kwd] === undefined && kwd !== '') {
      kwd = kwd.slice(0, kwd.length-1);
    }
    words[i] = words[i] + getEmojis(kwd, word.slice(word.length-1));
  }
  return words.join(' ');
}

function getEmojis(kwd, lastChar) {
  if (kwd === '' && lastChar === '!') {
    return getEmoji(randEl(alpha));
  }
  let emoji = getEmoji(kwd);
  if (['!','?','.','~'].includes(lastChar)) {
    if (Math.random() > 0.75) {
      return emoji + getEmoji(kwd);
    }
  }
  return emoji;
}

var alpha = 'ABCDEFGHIJKLMNOPQRSTUVWXYZ'.split('');

function getEmoji(kwd) {
  if (kwd === '') {
    return '';
  }
  let ary = index[kwd];
  if (ary[0].length > 0) {
    if (ary[1].length > 0 && Math.random() > 0.8) {
      return randEl(ary[0].concat(ary[1]));
    }
    return randEl(ary[0]);
  }
  if (ary[3].length > 0) {
    return randEl(ary[3]);
  }
  if (ary[1].length > 0 || ary[4].length > 0) {
    return randEl(ary[1].concat(ary[4]));
  }
  if (ary[2].length > 0) {
    return randEl(ary[2]);
  }
  return '';
}

function randEl(ary) {
  return ary[Math.floor(Math.random() * ary.length)];
}

var commonWords = 'I,OR,AM,THE,U,C,T'.split(',');
function makeCommonSwap(str) {
  switch (str) {
    case 'I':
      return 'EYE';
    case 'OR':
      return 'CANOE'; //get it? like an OAR
    case 'AM':
      return 'YAM';
  }
  return str;
}



function copyToClip() {
  navigator.clipboard.writeText(lastOutput);
}












// index = { <keyword> : [
//   0 : [emojis whose names start with an exact word match],
//   1 : [emojis whose names start with the keyword],
//   2 : [emojis whose names have a word that starts with the keyword],
//   3 : [emojis with a tag or shortcode with an exact word match],
//   4 : [emojis with a tag or shortcode starting with the keyword]
//  ]
// };

function makeIndex() {
  for (var emoji of emojis) {
    let name = emoji['name'].split(' ');
    let kwd,i,j,word;
    // Populate 1
    for (i = 1; i <= Math.min(3, name[0].length); i++) {
      kwd = name[0].slice(0, i);
      addToIndex(kwd, 1, emoji['emoji']);
    }
    // Populate 0
    addToIndex(name[0], 0, emoji['emoji']);
    // Populate 2
    for (word of name.slice(1)) {
      for (i = 1; i <= Math.min(3, word.length); i++) {
        kwd = word.slice(0, i);
        addToIndex(kwd, 2, emoji['emoji']);
      }
    }
    // Populate 3 & 4
    let tags = emoji['tags'].concat(emoji['shortcodes']);
    for (i = 0; i < tags.length; i++) {
      addToIndex(tags[i], 3, emoji['emoji']);
      for (j=1; j <= Math.min(3, tags[i].length); j++) {
        kwd = tags[i].slice(0, j);
        addToIndex(kwd, 4, emoji['emoji']);
      }
    }
  }
}
function addToIndex(keyword, num, emoji) {
  keyword = keyword.toUpperCase()
  if (index[keyword] === undefined) {
    index[keyword] = [[],[],[],[],[]];
  }
  index[keyword][num].push(emoji);
}

// consolidate the emojis & remove extraneous info. database originally from
// https://github.com/milesj/emojibase/blob/master/packages/data/en/raw.json
// done
function consolidate() {
  var str = "var emojis = ["
  for (var emoji of emojis) {
    str += "{"
    let name = emoji.name;
    if (name.indexOf("FLAG: ") >= 0) {
      name = name.slice(6) + " FLAG";
    }
    str += "'name':'" + name + "',";
    str += "'emoji':'" + emoji['emoji'] + "',";
    str += "'tags':" + JSON.stringify(emoji['tags']) + ",";
    str += "'shortcodes':" + JSON.stringify(emoji['shortcodes']);
    str += "},"
  }
  str = str.slice(0, str.length-1);
  str += "];"
  console.log(str);
}






